Verenigde Staten / Verenigd Koninkrijk
Actie / Misdaad
165 minuten

goed

met Christian Bale, Tom Hardy en Anne Hathaway

Het is acht jaar geleden dat Batman (Christian Bale) in de duisternis is verdwenen en van een held in een banneling is veranderd.
Hij heeft de schuld van de dood van Harvey Dent op zich genomen en voor het grotere goed alles opgeofferd. Deze leugen heeft een 
tijd standgehouden, want onder het gewicht van de Dent Act, een antimisdaadwet, zijn de criminele activiteiten in Gotham City 
verpletterd. Maar alles verandert met de komst van een sluwe inbreekster met een mysterieuze agenda. Veel gevaarlijker echter is 
de opkomst van Bane (Tom Hardy), een gemaskerde terrorist die meedogenloze plannen heeft voor Gotham en Bruce Wayne dwingt om 
uit zijn zelfopgelegde ballingschap terug te keren. Maar zelfs als hij zijn cape opnieuw aantrekt, zou Batman wel eens geen 
partij voor Bane kunnen zijn.
